#include <iostream>
#include <cmath>
#include <vector>
using namespace std;


// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏, —è–≤–ª—è–µ—Ç—Å—è –ª–∏ —á–∏—Å–ª–æ –ø—Ä–æ—Å—Ç—ã–º
bool isPrime(int n) {
    if (n <= 1) return false;
    if (n <= 3) return true;
    if (n % 2 == 0 || n % 3 == 0) return false;
    for (int i = 5; i * i <= n; i += 6) {
        if (n % i == 0 || n % (i + 2) == 0) return false;
    }
    return true;
}


// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –≤—ã—á–∏—Å–ª–µ–Ω–∏—è –Ω–∞–∏–±–æ–ª—å—à–µ–≥–æ –æ–±—â–µ–≥–æ –¥–µ–ª–∏—Ç–µ–ª—è –¥–≤—É—Ö —á–∏—Å–µ–ª —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –ï–≤–∫–ª–∏–¥–∞
int calculateNOD(int a, int b, int& x, int& y) {
    if (b == 0) {
        x = 1;
        y = 0;
        return a;
    }
    int x1, y1;
    int d = calculateNOD(b, a % b, x1, y1);
    x = y1;
    y = x1 - (a / b) * y1;
    return d;
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –≤—ã—á–∏—Å–ª–µ–Ω–∏—è –º–æ–¥—É–ª –æ–±—Ä–∞—Ç–Ω–æ–≥–æ 'a' –ø–æ –º–æ–¥—É–ª—é 'm'
int calculateModInverse(int a, int m) {
    int x, y;
    int gcd = calculateNOD(a, m, x, y);
    if (gcd != 1) {
        throw runtime_error("–û–±—Ä–∞—Ç–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –Ω–µ —Å—É—â–µ—Å—Ç–≤—É–µ—Ç");
    }
    else {
        return (x % m + m) % m;
    }
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –≥–µ–Ω–µ—Ä–∞—Ü–∏–∏ –æ—Ç–∫—Ä—ã—Ç–æ–≥–æ –∏ –∑–∞–∫—Ä—ã—Ç–æ–≥–æ –∫–ª—é—á–µ–π –¥–ª—è —à–∏—Ñ—Ä–æ–≤–∞–Ω–∏—è RSA
void generateRSAKeys(int prime1, int prime2, int& publicKeyExponent, int& privateKeyExponent, int& modulus) {
    modulus = prime1 * prime2;
    int phi = (prime1 - 1) * (prime2 - 1);
    // –í—ã–±–æ—Ä –æ—Ç–∫—Ä—ã—Ç–æ–≥–æ —ç–∫—Å–ø–æ–Ω–µ–Ω—Ç–∞ 'e'
    publicKeyExponent = 2; // –ù–∞—á–∏–Ω–∞–µ–º —Å –æ–±—â–µ–≥–æ –≤—ã–±–æ—Ä–∞ –¥–ª—è e
    int x, y; // –ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ –¥–ª—è —Ä–∞—Å—à–∏—Ä–µ–Ω–Ω–æ–≥–æ –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –ï–≤–∫–ª–∏–¥–∞
    while (calculateNOD(publicKeyExponent, phi, x, y) != 1) {
        publicKeyExponent++;
    }
    // –í—ã—á–∏—Å–ª–µ–Ω–∏–µ –∑–∞–∫—Ä—ã—Ç–æ–≥–æ —ç–∫—Å–ø–æ–Ω–µ–Ω—Ç–∞ 'd' –∫–∞–∫ –º–æ–¥—É–ª –æ–±—Ä–∞—Ç–Ω–æ–≥–æ 'e'
    privateKeyExponent = calculateModInverse(publicKeyExponent, phi);
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —à–∏—Ñ—Ä–æ–≤–∞–Ω–∏—è —Å–æ–æ–±—â–µ–Ω–∏—è —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º –æ—Ç–∫—Ä—ã—Ç–æ–≥–æ –∫–ª—é—á–∞ (e, n)
int encrypt(int message, int publicKeyExponent, int modulus) {
    int result = 1;
    for (int i = 0; i < publicKeyExponent; i++) {
        result = (result * message) % modulus;
    }
    return result;
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –¥–µ—à–∏—Ñ—Ä–æ–≤–∞–Ω–∏—è —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º –∑–∞–∫—Ä—ã—Ç–æ–≥–æ –∫–ª—é—á–∞ (d, n)
int decrypt(int ciphertext, int privateKeyExponent, int modulus) {
    int result = 1;
    for (int i = 0; i < privateKeyExponent; i++) {
        result = (result * ciphertext) % modulus;
    }
    return result;
}


// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —Ñ–∞–∫—Ç–æ—Ä–∏–∑–∞—Ü–∏–∏ —á–∏—Å–ª–∞
void factorize(int n, int ciphertext, int publicKeyExponent) {
    for (int i = 2; i <= n / 2; i++) {
        if (n % i == 0 && isPrime(i) && isPrime(n / i)) {
            //—Å –ø–æ–º–æ—â—å—é –Ω–∏—Ö –º–æ–∂–µ–º –ø–æ–ø—Ä–æ–±–æ–≤–∞—Ç—å —É–∑–Ω–∞—Ç—å –ø—Ä–∏–≤–∞—Ç–Ω—ã–π –∫–ª—é—á
            cout << "–ú–Ω–æ–∂–∏—Ç–µ–ª–∏ –º–æ–¥—É–ª—è, –∫–æ—Ç–æ—Ä—ã–µ –º—ã —É–∑–Ω–∞–ª–∏ —Å –ø–æ–º–æ—â—å—é —Ñ–∞–∫—Ç–æ—Ä–∏–∑–∞—Ü–∏–∏: " << i << " –∏ " << n / i << endl<<endl;
            // –ó–¥–µ—Å—å –≤—ã—á–∏—Å–ª—è–µ–º –∑–∞–∫—Ä—ã—Ç—ã–π –∫–ª—é—á
            int prime1 = i;
            int prime2 = n / i;
            int modulus = prime1 * prime2;
            int phi = (prime1 - 1) * (prime2 - 1);
            int x, y;
            int privateKeyExponent = calculateModInverse(publicKeyExponent, phi);

            //
            cout << "–ü—Ä–µ–¥–ø–æ–ª–∞–≥–∞–µ–º—ã–π –∑–∞–∫—Ä—ã—Ç—ã–π –∫–ª—é—á (–∏—Å—Ö–æ–¥—è –∏–∑ –º–µ—Ç–æ–¥–∞ —Ñ–∞–∫—Ç–æ—Ä–∏–∑–∞—Ü–∏–∏): {" << privateKeyExponent << ", " << modulus << "}" << std::endl;
            //
            cout << "–ü—Ä–µ–¥–ø–æ–ª–∞–≥–∞–µ–º–æ–µ –¥–µ—à–∏—Ñ—Ä–æ–≤–∞–Ω–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ: " << decrypt(ciphertext, privateKeyExponent, modulus) << endl;
            return;
        }
    }
    cout << "–ù–µ —É–¥–∞–ª–æ—Å—å –≤—ã–ø–æ–ª–Ω–∏—Ç—å —Ñ–∞–∫—Ç–æ—Ä–∏–∑–∞—Ü–∏—é." << std::endl;
}

int main() {
    setlocale(LC_ALL, "Russian");
    // –¥–≤–∞ –ø—Ä–æ—Å—Ç—ã—Ö —á–∏—Å–ª–∞
    int prime1 = 11;
    int prime2 = 13;
    int modulus, publicKeyExponent, privateKeyExponent;

    // –ì–µ–Ω–µ—Ä–∏—Ä—É–µ–º –æ—Ç–∫—Ä—ã—Ç—ã–π –∏ –∑–∞–∫—Ä—ã—Ç—ã–π –∫–ª—é—á–∏ –¥–ª—è —à–∏—Ñ—Ä–æ–≤–∞–Ω–∏—è RSA
    generateRSAKeys(prime1, prime2, publicKeyExponent, privateKeyExponent, modulus);

    cout << "–û—Ç–∫—Ä—ã—Ç—ã–π –∫–ª—é—á: {" << publicKeyExponent << ", " << modulus << "}" << endl;

    cout << "–ó–∞–∫—Ä—ã—Ç—ã–π –∫–ª—é—á: {" << privateKeyExponent << ", " << modulus << "}" << endl;

    // —Å–æ–æ–±—â–µ–Ω–∏–µ –¥–ª—è —à–∏—Ñ—Ä–æ–≤–∞–Ω–∏—è, –æ–Ω–æ –¥–æ–ª–∂–Ω–æ –±—ã—Ç—å –º–µ–Ω—å—à–µ 143(—Ç–∫ –µ—Å—Ç—å –∑–∞–≤–∏—Å–∏–º–æ—Å—Ç—å –æ—Ç –º–æ–¥—É–ª—è)–¥–ª—è –¥—Ä—É–≥–∏—Ö —á–∏—Å–µ–ª-–¥—Ä—É–≥–∏–µ –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏—è
    int message = 141;
    // –®–∏—Ñ—Ä—É–µ–º —Å–æ–æ–±—â–µ–Ω–∏–µ
    int ciphertext = encrypt(message, publicKeyExponent, modulus);
    // –î–µ—à–∏—Ñ—Ä—É–µ–º
    int decryptedMessage = decrypt(ciphertext, privateKeyExponent, modulus);

    // –í—ã–≤–æ–¥–∏–º –∏—Å—Ö–æ–¥–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ
    cout << "–ò—Å—Ö–æ–¥–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ: " << message << endl<<endl;
    factorize(modulus, ciphertext, publicKeyExponent);

    // –í—ã–≤–æ–¥–∏–º –∑–∞—à–∏—Ñ—Ä–æ–≤–∞–Ω–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ
    cout <<endl<< "–ó–∞—à–∏—Ñ—Ä–æ–≤–∞–Ω–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ: " << ciphertext << endl;
    // –í—ã–≤–æ–¥–∏–º –¥–µ—à–∏—Ñ—Ä–æ–≤–∞–Ω–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ
    cout << "–î–µ—à–∏—Ñ—Ä–æ–≤–∞–Ω–Ω–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ: " << decryptedMessage << endl;

    return 0;
}

